import { Dialog } from "@mui/material";
import React from "react";
import Menu from "../chat/menu/Menu";
import { Box } from "@mui/material";

const dialogStyle={
    height: "95%",
    width: "100%",
    margin: "20px",
    borderRadius: "none",
    maxWidth: "100%",
    maxHeight: "100%",
    boxShadow: "none",
}

const ChatDialog=()=>{
    return (
        <Dialog open={true} PaperProps={{sx: dialogStyle}} hideBackdrop>
           <Box>
            <Box>

            </Box>
            <Box>
                <Menu />
            </Box>
           </Box>
        </Dialog>
    );
}

export default ChatDialog;
